import { renderComponent } from "./runtime";
import { ComponentModel } from "./ComponentModel";
import { ComponentNodeModel } from "./NodeModel";
import qs from "qs";
import { colors, spacing } from "./theme";
// import components from "./components.json";

export const fetchComponents = async (
  id: string
): Promise<{ name: string; components: Record<string, ComponentModel> }> => {
  console.log({ id });
  const res = await fetch("https://toddle.onrender.com/v1/graphql", {
    method: "POST",
    headers: {
      "x-hasura-admin-secret": "wj75DVgisfBanV4",
    },
    body: JSON.stringify({
      query: `
      query FetchComponentById($id:ID!) {
        component(id:$id) {
          events
          functions
          _project
          id
          initialState
          name
          nodes
          props
              variables
          queries {
            documentNode
            variables
            api {
              id
              auth
              headers
              url
            }
          }

        }
      }
      `,
      variables: {
        id,
      },
    }),
  });
  if (res.ok === false) {
    throw new Error(await res.text());
  }
  const { data } = await res.json();
  const component = data.component as ComponentModel;

  console.log({ id, component });
  const fetchSubComponents = async (
    names: string[],
    componentMap: Record<string, ComponentModel>
  ): Promise<Record<string, ComponentModel>> => {
    if (names.length === 0) {
      return componentMap;
    }
    const result = await fetch("https://toddle.onrender.com/v1/graphql", {
      method: "POST",
      headers: {
        "x-hasura-admin-secret": "wj75DVgisfBanV4",
      },
      body: JSON.stringify({
        query: `
      query getComponentsByName($names: [String!]!, $project: uuid!) {
          components(where: { name: { _in: $names }, _project: { _eq: $project } }) {
          id
          name
          _project
          variables
          props
          functions
          events
          nodes
          page {
            id
            path
            requireAuth
          }
          queries {
              id
              type
              documentNode
              name
              variables
              api {
                id
                headers
                auth
                name
                url
                _project
              }
          }

          }
        }
      `,
        variables: {
          project: component._project,
          names,
        },
      }),
    });

    const { data } = await result.json();

    const components = data.components as ComponentModel[];

    const subComponents: string[] = components
      .flatMap((component) => Object.values(component.nodes))
      .filter(
        (node): node is ComponentNodeModel =>
          node.type === "component" && componentMap[node.name] === undefined
      )
      .map((node) => node.name);

    return fetchSubComponents(
      subComponents,
      components.reduce((acc, c) => ({ ...acc, [c.name]: c }), componentMap)
    );
  };

  const subComponents = component
    ? await fetchSubComponents(
        Object.values(component.nodes)
          .filter((c): c is ComponentNodeModel => c.type === "component")
          .map((c) => c.name),
        {}
      )
    : undefined;

  return {
    name: component.name,
    components: {
      ...subComponents,
      [component.name]: component,
    },
  };
};

const main = async () => {
  insertTheme();
  console.log(window.location.search);
  const query = qs.parse(window.location.search);
  const root = document.getElementById("App");
  if (!root) {
    throw new Error("Cant find node with id 'App'");
  }

  const { components, name } = await fetchComponents(
    typeof query.id === "string"
      ? query.id
      : "b03b483d-04e0-496f-98ed-92fcb4280426"
  );
  renderComponent(root, name, components as any);
};

const insertTheme = () => {
  const colorVars = Object.entries(colors).flatMap(([color, variants]) =>
    Object.entries(variants).map(
      ([variant, value]) => `--${color}-${variant}:${value}`
    )
  );
  const styleElem = document.createElement("style");
  styleElem.setAttribute("type", "text/css");
  styleElem.innerText = `
      body {
        --spacing:${spacing};
        ${colorVars.join(";\n")};
      }
  `;
  document.head.appendChild(styleElem);
};

main();
